def decrypt(data: bytes):
    a1 = bytearray(data)
    a2 = len(a1)
    if a1[2] == 0x4F: v8, v9, v6, v7 = 1, 4, 5, 6
    else: v8, v9, v6, v7 = 0, 2, 3, 4
    v10 = a1[v6]
    if v10 == 1:
        v22 = v9 + 3; v13 = a2 - v22
        if v13 <= 0: return b""
        v18 = a1[v7] - v22; dec = bytearray(v13)
        for i in range(v13):
            index = v22 + i
            key = byte_1703BE0[(v18 + index) % 33]
            dec[i] = a1[index] ^ key
        return bytes(dec)
    elif v10 == 2:
        v22 = v9 + 3; v13 = a2 - v22
        if v13 <= 0: return b""
        v21 = a1[v7]; a1_c = bytearray(data)
        for i in range(7 if v9 == 4 else 5):
            index = v13 + i
            if index >= a2: break
            a1_c[i] = a1[index] ^ byte_1703BE0[(v21 + i) % 33 + 48]
        b = v13 - v22
        if b > 95: b = 95
        v24 = b + v22
        if v22 < v24:
            k = v21 + v22
            for i in range(b): a1_c[v22 + i] ^= byte_1703BE0[(k + i) % 33 + 48]
        return bytes(a1_c[:v13])
    else:
        v22 = 7 if v8 else 5
        return data[v22:] if a2 > v22 else b""

def decompress_ccz(ccz_data: bytes) -> bytes:
    return zlib.decompress(ccz_data[16:])

def correct_pixels(pixel_data: bytes, is_premultiplied: bool, is_bgra: bool) -> bytes:
    corrected = bytearray(len(pixel_data))
    for i in range(0, len(pixel_data), 4):
        b, g, r, a = pixel_data[i:i+4] if is_bgra else (pixel_data[i], pixel_data[i+1], pixel_data[i+2], pixel_data[i+3])
        if is_premultiplied and a > 0:
            r, g, b = min(255, int(r*255/a)), min(255, int(g*255/a)), min(255, int(b*255/a))
        elif is_premultiplied and a == 0:
            r, g, b = 0, 0, 0
        corrected[i:i+4] = [r, g, b, a]
    return bytes(corrected)

def pvr_bytes_to_image(pvr_data: bytes) -> Image.Image:
    h = struct.unpack('<IQIIIIIIIII', pvr_data[4:52])
    flags, _, height, width, metadata_size = h[0], h[1], h[4], h[5], h[10]
    return Image.frombytes('RGBA', (width, height),\
            correct_pixels(decode_etc2a8(pvr_data[52 + metadata_size:], width, height), (flags & 0x02) != 0, True))

def process(path: str, dir: str):
    r = os.path.relpath(path, dir)
    with open(path, 'rb') as f:
        c = f.read()
    if c.startswith(b'UF'):
        print(f": {r}")
        dec = decrypt(c)
        if dec.startswith(b'CCZ!'):
            pvr_image = pvr_bytes_to_image(decompress_ccz(dec))
            os.remove(path)
            pvr_image.save(os.path.splitext(path)[0] + '.png', 'PNG')
            
        else:
            with open(path, 'wb') as f:
                f.write(dec)
        return
    elif c.startswith(b'CCZ!'):
        print(f": {r}")
        pvr_image = pvr_bytes_to_image(decompress_ccz(c))
        pvr_image.save(os.path.splitext(path)[0] + '.png', 'PNG')

if __name__ == '__main__':
    data = sys.argv[1]
    with ProcessPoolExecutor() as e:
        e.map(functools.partial(process, dir=data), [os.path.join(r, fn) for r, _, n in os.walk(data) for fn in n])